import React, { Component } from "react";
import styled from "styled-components";

export class SimulationParamContainer extends Component {
  render() {
    return (
      <Container>
        <InfoContainer>
          <SimulationTitle>Hello world!</SimulationTitle>
          <SimulationDescription>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
            eiusmod tempor incididunt ut labore et dolore magna aliqua.
          </SimulationDescription>
        </InfoContainer>
        <ActionContainer>
          <RunButton>Run</RunButton>
          <EditButton>Edit</EditButton>
        </ActionContainer>
      </Container>
    );
  }
}

export function SimulationParamContainerNew(props) {
  return (
    <Container className="flex bg-white border-"></Container>
  )
}

export function Container(props) {
  return (
    <div className="flex bg-white border-8 rounded-sm border-pink-500 text-black justify-center p-1 m-0.5">
      {props.children}
    </div>
  )
}

const RunButton = styled.button`
  width: 100%;
  font-size: 16px;
  color: white;
  background-color: green;
  align-self: flex-end;
  border-radius: 5px;

`;

const EditButton = styled.button`
  width: 100%;
  color: white;
  border-radius: 5px;
  font-size: 16px;
  background-color: orange;
  align-self: flex-end;
`;

